import React, { useState, useEffect } from 'react';
import { Box, Typography, Button, Paper, Grid } from '@mui/material';
import { styled } from '@mui/material/styles';
import StarIcon from '@mui/icons-material/Star';
import { keyframes } from '@mui/system';

const fadeIn = keyframes`
  from {
    opacity: 0;
  }
  to {
    opacity: 1;
  }
`;

const SceneContainer = styled(Box)(({ theme }) => ({
  width: '100%',
  height: '100%',
  display: 'flex',
  flexDirection: 'column',
  alignItems: 'center',
  justifyContent: 'center',
  backgroundImage: 'url("https://i.redd.it/zu89x21nnei71.png")',
  backgroundSize: 'cover',
  backgroundPosition: 'center',
  position: 'relative',
  animation: `${fadeIn} 2s ease-in`,
}));

const ResultsContainer = styled(Paper)(({ theme }) => ({
  padding: theme.spacing(4),
  backgroundColor: 'rgba(0, 0, 0, 0.8)',
  color: 'white',
  borderRadius: '15px',
  textAlign: 'center',
  maxWidth: '600px',
  width: '90%',
  marginBottom: theme.spacing(4),
}));

const StarContainer = styled(Box)(({ theme }) => ({
  display: 'flex',
  justifyContent: 'center',
  gap: theme.spacing(1),
  margin: theme.spacing(2, 0),
}));

const Star = styled(StarIcon)(({ theme, active }) => ({
  color: active ? '#ffd700' : '#666666',
  fontSize: '3rem',
}));

const ContinueButton = styled(Button)(({ theme }) => ({
  marginTop: theme.spacing(2),
  backgroundColor: '#4CAF50',
  color: 'white',
  '&:hover': {
    backgroundColor: '#45a049',
  },
}));

const Island = styled(Box)(({ theme, unlocked }) => ({
  width: '100px',
  height: '100px',
  borderRadius: '50%',
  backgroundColor: unlocked ? '#4CAF50' : '#666666',
  display: 'flex',
  alignItems: 'center',
  justifyContent: 'center',
  color: 'white',
  cursor: unlocked ? 'pointer' : 'not-allowed',
  transition: 'all 0.3s ease',
  '&:hover': {
    transform: unlocked ? 'scale(1.1)' : 'none',
  },
}));

const VictoryScene = ({ results }) => {
  const [showMap, setShowMap] = useState(false);

  useEffect(() => {
    // Show the world map after a delay
    const timer = setTimeout(() => {
      setShowMap(true);
    }, 3000);

    return () => clearTimeout(timer);
  }, []);

  return (
    <SceneContainer>
      <ResultsContainer elevation={3}>
        <Typography variant="h4" gutterBottom>
          Victory!
        </Typography>
        
        <StarContainer>
          {[...Array(3)].map((_, index) => (
            <Star key={index} active={index < results.stars} />
          ))}
        </StarContainer>

        <Typography variant="h6" gutterBottom>
          Score: {results.score}/{results.totalQuestions}
        </Typography>
        <Typography variant="h6" gutterBottom>
          Hearts Remaining: {results.hearts}
        </Typography>

        <Typography variant="body1" gutterBottom>
          Well done, chosen one. Now your journey truly begins...
        </Typography>

        {showMap && (
          <Grid container spacing={3} sx={{ mt: 3 }}>
            <Grid item xs={12}>
              <Typography variant="h5" gutterBottom>
                The World of Vocabia
              </Typography>
            </Grid>
            <Grid item xs={12} container justifyContent="center" spacing={2}>
              <Grid item>
                <Island unlocked={true}>
                  Grammar Gorge
                </Island>
              </Grid>
              <Grid item>
                <Island unlocked={false}>
                  Island 2
                </Island>
              </Grid>
              <Grid item>
                <Island unlocked={false}>
                  Island 3
                </Island>
              </Grid>
              <Grid item>
                <Island unlocked={false}>
                  Island 4
                </Island>
              </Grid>
              <Grid item>
                <Island unlocked={false}>
                  Island 5
                </Island>
              </Grid>
            </Grid>
          </Grid>
        )}

        <ContinueButton
          variant="contained"
          onClick={() => {
            // Navigate to the first island
            window.location.href = '/island/1';
          }}
        >
          Enter Grammar Gorge
        </ContinueButton>
      </ResultsContainer>
    </SceneContainer>
  );
};

export default VictoryScene;
